<?php

    require './vendor/autoload.php';

    use Dompdf\Dompdf;
    
    defined('BASEPATH') OR exit('No direct script access allowed');
    
    class Invoices extends CI_Controller {
    
        
        public function __construct()
        {
            parent::__construct();
            if ($this->session->userdata('type')!='authorized') {
                redirect(site_url('login'));
            }
        }
        

        public function create_invoice(){

            // print_r($_POST);

            $item_ids = $this->input->post('items');
            
            $this->load->model('ItemsModel');

            $items_data = array();
            
            foreach ($item_ids as $item_id) {

                $item_data = $this->ItemsModel->fetch_item_by_id($item_id);

                $items_data[] = $item_data;

            }

            $quantities = $this->input->post('qty');

            $total_prod_costs = $this->input->post('total-prod-cost');
           
            $prod_cost = $this->input->post('prod-costs');

            $cloth_reqd = $this->input->post('cloth-reqd');
            
            $cloth_costs = $this->input->post('cloth-cost');

            $sizes = $this->input->post('sizes');


            $rates = array();

            for ($i=0; $i < count($item_ids); $i++) { 
                $rate = $total_prod_costs[$i]/$quantities[$i];
                $rates[] = $rate+($rate*0.25);
            }
            
            $allsizes = array();

            for($r=22;$r<=42;$r++){
                if($r%2==0){
                    $allsizes[] = $r;
                }
            }

            // var_dump($allsizes);


            $sizesSelected = array();

            foreach($sizes as $size){

                $sizesSelected[] = $allsizes[$size];

            }

            // var_dump($sizesSelected);


            $_POST['rates'] = $rates;

            $itemsHTML = '';
            $totalCost = 0.00;

            for ($i=0; $i < count($prod_cost); $i++) { 
                $price = $prod_cost[$i]+($cloth_reqd[$i]*$cloth_costs[$i]);
                $price = $price+(0.25*$price);
                $amount = $quantities[$i]*$price;
                $amount = ceil($amount);
                $itemsHTML.='<tr class="item"> <td>'.$items_data[$i]['title'].'</td><td style="text-align: center;">'.$quantities[$i].'</td><td style="text-align: center;">Rs. '.$price.'</td><td style="text-align: center;">'.$sizesSelected[$i].'</td><td style="text-align: center;">Rs. '.$amount.'</td></tr>';
                $totalCost = $totalCost+$amount;
                $price = 0;
                $amount = 0;

            }

            $totalRow = '<tr class="item" style="margin-top: 10%;"> <td style="text-align: center;"></td><td style="text-align: center;"></td><td>Total:</td><td style="text-align: center; font-weight: 900; font-size: 120%;">Rs. '.$totalCost.'</td></tr></table>';

            $itemsHTML = $itemsHTML.$totalRow;

            $path = site_url('assets/images/logo.png');
            $imgLogo = file_get_contents($path);
            $basesixtyfourimg = base64_encode($imgLogo);
            

            $tnc ='<br><br><ol><li>Order will be processed after 50% advance payment.</li>
            <li>Prices may vary Quality wise.</li><li>For custom collar, collar and check, charges extra.</li><li>All prices are inclusive GST.</li><li>Logo printing, Monogram and embroidery charges extra.</li></ol><div style="text-align: left;">
            </div><div style="text-align: right;"><br><br>______________________<br>
            <h4>Authorized Signatory</h4>
            </div>';

            $authorizedSignatory = '';

            $itemsHTML.=$tnc;

            $itemsHTML.=$authorizedSignatory;



            $dompdf = new Dompdf();

            $options = $dompdf->getOptions(); 
            $options->set(array('enable_remote' => true));
            $dompdf->setOptions($options);




            $dompdf->loadHtml('<!DOCTYPE html><html> <head> <meta charset="utf-8"/> <title>Quotation for '.$_POST['payee_name'].'</title> <style>.invoice-box{max-width: 800px; margin: auto; padding: 30px; border: 1px solid #eee; box-shadow: 0 0 10px rgba(0, 0, 0, 0.15); font-size: 16px; line-height: 24px; font-family: "Helvetica Neue", "Helvetica", Helvetica, Arial, sans-serif; color: #555;}.invoice-box table{width: 100%; line-height: inherit; text-align: left;}.invoice-box table td{padding: 5px; vertical-align: top;}.invoice-box table tr td:nth-child(2){text-align: right;}.invoice-box table tr.top table td{padding-bottom: 20px;}.invoice-box table tr.top table td.title{font-size: 45px; line-height: 45px; color: #333;}.invoice-box table tr.information table td{padding-bottom: 40px;}.invoice-box table tr.heading td{background: #eee; border-bottom: 1px solid #ddd; font-weight: bold;}.invoice-box table tr.details td{padding-bottom: 20px;}.invoice-box table tr.item td{border-bottom: 1px solid #eee;}.invoice-box table tr.item.last td{border-bottom: none;}.invoice-box table tr.total td:nth-child(2){border-top: 2px solid #eee; font-weight: bold;}@media only screen and (max-width: 600px){.invoice-box table tr.top table td{width: 100%; display: block; text-align: center;}.invoice-box table tr.information table td{width: 100%; display: block; text-align: center;}}/** RTL **/ .rtl{direction: rtl; font-family: Tahoma, "Helvetica Neue", "Helvetica", Helvetica, Arial, sans-serif;}.rtl table{text-align: right;}.rtl table tr td:nth-child(2){text-align: left;}</style> </head> <body> <div class="invoice-box"> <table cellpadding="0" cellspacing="0"> <tr class="top"> <td colspan="4"> <table> <tr> <td class="titlex"><img width="150px" height:"75px" alt="" src="data:image/png;base64," /><h5>Vintage Clothing Company</h5><span>Onkar Manjusha Katra,<br> Main Road, Padrauna. <br>Kushinagar - 274304. <br> Mobile number: 852899099 <br> Email: info@pthgroup.in <br> GSTIN: 09BQSPA5511K1ZM</span></td><td > Quotation Code: '.$_POST['invoice_code'].'<br/> Created: '.date('d/m/Y').' <h4>'.$_POST['payee_name'].'</h4><span>'.$_POST['payee_address'].'. <br> Mobile number: '.$_POST['payee_mobile_number'].' <br> Email: '.$_POST['payee_email'].' </span></td></tr></table> </td></tr><tr class="information"> <td colspan="2"> <table> <tr style="width: 100%; display: none;"> <td style="text-align: right;">'.$_POST['payee_name'].'</td></tr></table> </td></tr><tr class="heading" > <td>Item</td><td style="text-align: center;">Quantity</td><td style="text-align: center;">Price</td><td style="text-align: center;">Size</td><td style="text-align: center;">Amount</td></tr>'.$itemsHTML.'</table> </div></body></html>');

            // (Optional) Setup the paper size and orientation
            $dompdf->setPaper('A4', 'potrait');

            // Render the HTML as PDF
            $dompdf->render();

            // Output the generated PDF to Browser
            $dompdf->stream();

            $this->load->database();
            
            $this->db->where('id','1');
            $inv_data = $this->db->get('invoices')->row_array();
            $new_latest_inv_id = $inv_data['latest_inv_id']+1;
        
            $this->db->where('id','1');
            $this->db->set('latest_inv_id',$new_latest_inv_id);
            $this->db->update('invoices');

        }

    
    }
    
    /* End of file Invoices.php */
    